/**
 * FAQ toggle code
 */
(function ($) {
  $(document).ready(function ($) {
    $('.faqs .question').on('click keydown', function (e) {
      if ('click' == e.type || 'keydown' == e.type && 13 == e.which) {
        e.preventDefault(); // Toggle aria pressed state

        $(this).attr('aria-expanded', function (index, attr) {
          return attr === 'false' ? 'true' : 'false';
        });
        $(this).toggleClass('active').next('.answer').toggleClass('expanded');
      }
    });
  });
})(jQuery);
;"use strict";

/**
 * Collapsible Content toggle code
 */
(function ($) {
  $(document).ready(function ($) {
    $('.collapsible-header').on('click keydown', function (e) {
      if ('click' == e.type || 'keydown' == e.type && 13 == e.which) {
        e.preventDefault(); // Toggle aria pressed state

        $(this).attr('aria-expanded', function (index, attr) {
          return attr === 'false' ? 'true' : 'false';
        });
        $(this).parents('.collapsible-content-wrapper').toggleClass('expanded');
      }
    });
  });
})(jQuery);
