/**
 * Tab post element scripts
 */
(function ($) {
  $(document).ready(function ($) {
    var tabs = $('.tabs-section .nav-tabs [role="tab"]');
    var tablist = $('.tabs-section [role="tablist"]'); // Add an event handler for switching tabs

    tabs.on('click', function (e) {
      e.preventDefault();
      var target = $(this);
      var parent = target.parent();
      var gparent = parent.parent();
      console.log('Selected tabs: ', parent.find('[aria-selected="true"]')); // Remove all currently selected tabs

      parent.find('[aria-selected="true"]').attr('aria-selected', 'false').removeClass('active'); // Set the current tab as selected

      target.attr('aria-selected', 'true').addClass('active');
      console.log('Selected tabpanels: ', gparent.find('[role="tabpanel"]'));
      var tabpanels = gparent.find('[role="tabpanel"]'); // Hide all tab panels

      tabpanels.removeClass('in').removeClass('active').attr('hidden', 'hidden'); // Show selected panel

      $('#' + target.attr('aria-controls')).addClass('active').addClass('in').removeAttr('hidden');
    }); // Enable arrow navigation between tabs in the tab list

    var tabfocus = 0;
    tablist.on('keydown', function (e) {
      // Move right
      if (39 == e.keyCode || 37 == e.keyCode) {
        $(tabs.get(tabfocus)).attr('tabindex', -1);

        if (39 == e.keyCode) {
          tabfocus++; // If were at the end, go to the start

          if (tabfocus >= tabs.length) {
            tabfocus = 0;
          } // Move left

        } else if (37 == e.keyCode) {
          tabfocus--; // If we're at the start, move to the end

          if (tabfocus < 0) {
            tabfocus = tabs.length - 1;
          }
        }
      }

      $(tabs.get(tabfocus)).attr('tabindex', 0);
      $(tabs.get(tabfocus)).focus();
    });
  });
})(jQuery);
